import { Box, Grommet, Main } from 'grommet';

const LoginPage = () => (
  <Grommet>
    <Main
      direction="row"
    >
      <Box pad="medium" background={{
              "color": "neutral-1",
              "dark": true,
              "opacity": true,
              "position": "bottom",
              "repeat": "no-repeat",
              "size": "cover",
              "image": "url(//localhost:3000/assets/img.png)",
        }}

        height="100%"

      >

      </Box>
      <Box pad="small" background="light-3" />
    </Main>
  </Grommet>
)

export default LoginPage;
